Transylv. Rev. Syst. Ecol. Res. 20.1 (2018), " The Wetlands Diversity" 43 ANTIOXIDANT SYSTEM OF RAPANS UNDER THE ACTION OF COPPER IONS AND ANIONIC DETERGENT. Oksana   ERSHOVA   *,   Valentin   TOPTIKOV   *,   Tatyana LAVRENYUK *,   Oleg   KOVTUN   *   and   Vladlen   TOTSKY   *  *    Odessa    National    Mechnikov    University,    Dvoryanskaya    Street    2,    Odessa,   Ukraine,    UA -65082,   ershova@mail.ru,   v.a.toptikov@gmail.com, v.totsky@onu.edu.ua ;   DOI: 10.1515/trser -2018-0004; KEYWORDS :   Rapana venosa , antioxidant system, copper, anionic detergent .   ABSTRACT The antioxidant system in various organs of rapana ( Rapana venosa ) has   been studied   in   condition   of   contamination   of   medium   with   copper   ions   ( 5   and   10   MPC)   and   sodium    dodecyl   sulphate   ( 5   and   20   MPC).   The   most   significant   changes   in   the   antioxidant   status   of    cells occurred mainly during the first hours ( three-24 hours) of exposure to toxic compounds.   At   the   end   of   observations   (72   hours)   stabilization   of   the   main   parameter s   of   the   antioxidant    system and return of its main indicators to control values were noted.   Ktenidiy proved to be the   most sensitive organ reacting to toxic doses of both copper and sodium dodecyl sulphate in the   medium.   Nephridiy   cells   turned   out   to   be   weakly   susceptible   to   the   action   of   the   studied    toxicants.   The    high   lability   and   power   of   the   antioxidant   system   of   rapans   provides   a    significant adaptive potential for   the mollusk.     

