 Identification of  Sodium Lauryl Sulphate in Toothpaste using  Green Solvent by Thin - Layer Chromatography .
 Rizwana Mobin * 1 , Tauseef Ahmad Rangreez 2;
 1 Government College for Women, M.A.  Road, Srinagar, Jammu & Kashmir; 2 Department of Chemistry,
National Institute of Technology (NIT), Srinagar, Jammu & Kashmir, India. Abstract: Anionic  surfactants  are  widely  used  in  personal  care  products  (toothpaste,  soap,  shampoo,  liquid  soaps)  because  of  their  excellent  cleaning  and  emulsifying  properties.  Sodium  lauryl  sulfate  (SLS)  is  popularly  used  as  a  foaming and cleaning agent in shampoo, toothpaste and washing products. Aqueous solutions of SLS are commonly used  for  the  dispersion  of  carbon  nanotubes  (CNT).  Anionic  surfactants,  being  water  soluble  compounds,  easily  enter  into  rivers  and  other  water  bodies  through  wastewater  discharge  and  at  sufficient  concentration  become  toxic  to  aquatic  organisms.  Thin  layer  chromatography  (TLC)  involves  separation  of  components  from  their  mixtures  based  on  the  competitive  interactions of analyte  with stationary  and mobile phases.  In the  present study, sodium  lauryl  sulphate  has  been identified on a silica gel G static flat phase with 2 - butanol/ethyl ac etate as the mobile phase. Use of 2 - butanol and  ethyl  acetate  as  the  mobile  phase  makes  TLC  green  for  the  identification  of  sodium  lauryl  sulphate  in  toothpaste.  Densitogram of sodium lauryl sulphate has been also carried out. 
Keywords: Anionic surfactant s; Sodium lauryl sulphate; Thin - layer chromatography; Green solvent; 
